window.sensorDeployment = {
  getSensors: function () {
    var get = new Promise(function (resolve) {
      Papa.parse("sensors.csv", {
        download: true,
        header: true,
        complete: function (res) {
          // res is an array of objects that represent each row in table
          result = resolve(res);
        }
      });
    });
    return get;
  }
};

window.sensordb = function () {
  this.connect = function (host, port) {
    // hardcoded db
    this.influx = new Influx.InfluxDB({
      host: host,
      port: port,
      username: 'visualize',
      password: 'visualize',
      database: 'dev'
    });
  };

  this.getValues = function (sensor) {
    // sensor is a deveui, such as 'a8-17-58-ff-fe-03-0f-53'
    // topic, table, retention, measurement are hardcoded
    const query = `SELECT "light", "humidity", "battery", "co2", "temperature", "pir" FROM "autogen"."mqtt_consumer" WHERE "deveui" = '${sensor}' AND "topic"='cwc/elsys/parsed' ORDER BY DESC LIMIT 1`;
    return this.influx.query(query).then(function (result) {
      if (result[0]) {
        var time = null;

        if (result[0].time) {
          const options = {
            year: 'numeric',
            month: 'long',
            day: 'numeric',
            hour: 'numeric',
            minute: 'numeric'
          };
          time = result[0].time.toLocaleString('fi-FI', options);
        }

        const ret = {
          battery: result[0].battery || "na",
          lastSeen: time || "unknown",
          temperature: result[0].temperature || "na",
          humidity: result[0].humidity || "na",
          light: result[0].light || "na",
          pir: result[0].pir || "na",
          co2: result[0].co2 || "na"
        };
        return ret;
      } else {
        /* error */
        const ret = {
          battery: "na",
          lastSeen: "never",
          temperature: "na",
          humidity: "na",
          light: "na",
          pir: "na",
          co2: "na"
        };
        return ret;
      }
    });
  };
};

